"use client";

import { motion, AnimatePresence } from "framer-motion";
import Navbar from "./Navbar";

export default function Page() {
    return (
        <motion.div
            initial={{opacity :0}}
            animate={{opactiy :1}}
            exit={{opacity:0}}
            transition={{duration:1.3}}
        >
            <Navbar/>
        </motion.div>
    );

}
